import React from 'react';
import logo from './itachi.jpg';
import './App.css';
import 'utils/API.js'

class App extends React.component{
  constructor(props){
    super(props);
    this.state={apiResponse:""};
  }
  callAPI(){
    fetch("http://localhost:8800/test").then(res => res.text()).then(res => this.setState({apiResponse: res}))
  }
  componentWillMount(){
    this.callAPI;
  }
}
